import React from "react";

export default function Video({ setIsVideoPage }) {
    setIsVideoPage(true);

  return (
    <div className="video-page">
        <div className="left-side-container video-comments-container">
            <div className="video-container">
                <iframe width="560" height="315" src="https://www.youtube.com/embed/TBOmUuG-9BY?si=hau2xkIIvafO_kHN&amp;controls=0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
            </div>
        </div>
    </div>
  );
}
